      string: "{\r\n  \"name\" : \"Kumbale 2024 - Dioxin impact on Hepatic Cholesterol
        Biosynthesis\",\r\n  \"description\" : \"Multiscale model to assess the impact
        of dioxin exposure on cholesterol dynamics and steroidogenesis. This model
        is represented as a Template and Anchor Model (T&A). We use Generalized Mass
        Action ( GMA; i.e., power law) within this multiscale modeling framework.\",\r\n
        \ \"format\" : {\r\n    \"name\" : \"MATLAB (Octave)\",\r\n    \"identifier\"
        : \"matlab\",\r\n    \"version\" : \"*\"\r\n  },\r\n  \"publication\" : {\r\n
        \   \"type\" : \"PubMed ID\",\r\n    \"accession\" : \"37820785\",\r\n    \"journal\"
        : \"Food and chemical toxicology : an international journal published for
        the British Industrial Biological Research Association\",\r\n    \"title\"
        : \"Hepatic cholesterol biosynthesis and dioxin-induced dysregulation: A multiscale
        computational approach.\",\r\n    \"affiliation\" : \"Department of Biomedical
        Engineering, Georgia Institute of Technology, Atlanta, GA 30332, USA. Electronic
        address: Eberhard.voit@bme.gatech.edu; Qiang.zhang@emory.edu; Ckumbale3@gatech.edu.\",\r\n
        \   \"synopsis\" : \"Humans are constantly exposed to lipophilic persistent
        organic pollutants (POPs) that accumulate in fatty foods. Among the numerous
        POPs, dioxins, in particular 2,3,7,8-tetrachlorodibenzo-p-dioxin (TCDD), can
        impact several organ systems. While the hazard is clearly recognized, it is
        still difficult to develop a comprehensive understanding of the overall health
        impacts of dioxins. As chemical toxicity testing is steadily adopting new
        approach methodologies (NAMs), it becomes imperative to develop computational
        models that can bridge the data gaps between in vitro testing and in vivo
        outcomes. As an effort to address this challenge, we propose a multiscale
        computational approach using a \\\"template-and-anchor\\\" (T&A) structure.
        A template is a high-level umbrella model that permits the integration of
        information from various, detailed anchor models. In the present study, we
        use this T&A approach to describe the effect of TCDD on cholesterol dynamics.
        Specifically, we represent hepatic cholesterol biosynthesis as an anchor model
        that is perturbed by TCDD, leading to steatosis, along with alterations of
        plasma cholesterol. In the future, incorporating pertinent information from
        all anchor models into the template model will allow the characterization
        of the global effects of dioxin, which can subsequently be translated into
        overall - and ultimately personalized - human health risk assessment.\",\r\n
        \   \"year\" : 2023,\r\n    \"month\" : \"11\",\r\n    \"volume\" : \"181\",\r\n
        \   \"pages\" : \"114086\",\r\n    \"link\" : \"http://identifiers.org/pubmed/37820785\",\r\n
        \   \"authors\" : [\r\n      {\r\n        \"name\" : \"Carla M Kumbale\",\r\n
        \       \"institution\" : \"Department of Biomedical Engineering, Georgia
        Institute of Technology, Atlanta, GA 30332, USA. Electronic address: Ckumbale3@gatech.edu.\"\r\n
