      string: "{\r\n  \"name\" : \"Riya 2024 - Interplay between the immunologic network,
        inflammasome, and autophagy in non-small cell lung cancer (NSCLC).\",\r\n
        \ \"description\" : \"In later stages of NSCLC, we observed that the overexpression
        of IL-6 and IL-17 cytokines leads to macroautophagic and inflammatory responses,
        which contribute to disease progression.\",\r\n  \"format\" : {\r\n    \"name\"
        : \"SBML\",\r\n    \"identifier\" : \"SBML\",\r\n    \"version\" : \"L2V1\"\r\n
        \ },\r\n  \"publication\" : {\r\n    \"type\" : \"PubMed ID\",\r\n    \"accession\"
        : \"38279220\",\r\n    \"journal\" : \"International journal of molecular
        sciences\",\r\n    \"title\" : \"Traversing through the Mechanistic Event
        Analysis in IL-6 and IL-17 Signaling for a New Therapeutic Paradigm in NSCLC.\",\r\n
        \   \"affiliation\" : \"Systems Medicine Laboratory, National Centre for Cell
        Science, NCCS Complex, Ganeshkhind, SPPU Campus, Pune 411007, India.\",\r\n
        \   \"synopsis\" : \"IL-6 and IL-17 are paradoxical cytokines that progress
        inflammatory states in chronic diseases, including cancer. In lung cancer,
        their role has been elucidated to favor cancer development by modulating signaling
        mechanisms critical to cellular growth. The intrinsic ability of these cytokines
        to influence macroautophagy is yet another reason to facilitate lung cancer.
        Here, we employed a systems immunology approach to discover the mechanistic
        role of these cytokines in cancer development. In a biological system, at
        later stages, the activation of NFkB stimulates immunosuppressive phenotypes
        to achieve tolerating effects in a transformed cell. We found that the upregulation
        of cytokines signaled M2 macrophages to modulate tumor responses through the
        activation of autophagic intermediates and inflammasome mediators. This caused
        immune perturbations in the tumor microenvironment, which were associated
        with cancer inflammation. To address these inflammatory states, we performed
        triggered event analysis to examine whether overexpressing immune effectors
        or downregulating immune suppressors may have an effect on cancer reversal.
        Interestingly, the inhibition of immune regulators opposed the model outcome
        to an increased immune response. Therefore, IL6-IL17-mediated regulation of
        lung cancer may address tumor malignancy and potentiate the development of
        newer therapeutics for NSCLC.\",\r\n    \"year\" : 2024,\r\n    \"month\"
        : \"1\",\r\n    \"volume\" : \"25\",\r\n    \"issue\" : \"2\",\r\n    \"pages\"
        : \"1216\",\r\n    \"link\" : \"http://identifiers.org/pubmed/38279220\",\r\n
