      string: "{\r\n  \"name\" : \"Zhang 2024 - Genome-scale metabolic modelling reveals
        interactions and key roles of symbiont clades in a sponge holobiont\",\r\n
        \ \"description\" : \"We developed eight Genome-scale Metabolic Models for
        the microbiome of the sponge Stylissa sp. We also modelled metabolic interactions
        within the network of the eight-species microbiome by introducing different
        nutrients (such as HT, laurate, and a combination of both).\",\r\n  \"format\"
        : {\r\n    \"name\" : \"R\",\r\n    \"identifier\" : \"R\",\r\n    \"version\"
        : \"*\"\r\n  },\r\n  \"publication\" : {\r\n    \"type\" : \"Publication without
        link\",\r\n    \"journal\" : \"Nature Communications\",\r\n    \"title\" :
        \"Zhang et al 2024 - Genome-scale metabolic modelling reveals interactions
        and key roles of symbiont clades in a sponge holobiont\",\r\n    \"affiliation\"
        : \"1.\\tSchool of Biological, Earth and Environmental Sciences, University
        of New South Wales, Australia\\n2.\\tCentre for Marine Science and Innovation,
        University of New South Wales, Australia;\\n3.\\tSchool of Biotechnology and
        Biomolecular Sciences, University of New South Wales, Australia\\n4.\\tDepartment
        of Ocean Science, School of Science, The Hong Kong University of Science and
        Technology, Hong Kong, China\\n5.\\tResearch Group Medical Systems Biology,
        Institute of Experimental Medicine, University of Kiel and University Hospital
        Schleswig-Holstein, 24105 Kiel, Germany\\n6.\\tInstitute of Human Nutrition
        and Food Science, University of Kiel, 24105 Kiel, Germany\",\r\n    \"synopsis\"
        : \"Sponges harbour complex microbiomes and as ancient metazoans and important
        ecosystem players are emerging as powerful models to understand the evolution
        and ecology of symbiotic interactions. Metagenomic studies have previously
        described the functional features of sponge symbionts, however, little is
        known about the metabolic interactions and processes that occur under different
        environmental conditions. To address this issue, we construct here constraint-based,
        genome-scale metabolic networks for the microbiome of the sponge Stylissa
        sp.. Our models define the importance of sponge-derived nutrients for microbiome
        stability and discover how different organic inputs can result in net heterotrophy
        or autotrophy of the symbiont community. The analysis further reveals the
        key role that a newly discovered bacterial taxon has in cross-feeding activities
        and how it dynamically adjusts with nutrient inputs. Our study reveals insights
        into the functioning of a sponge microbiome and provides a framework to further
        explore and define metabolic interactions in holobionts.\",\r\n    \"year\"
        : 2024,\r\n    \"month\" : \"11\",\r\n    \"authors\" : [\r\n      {\r\n        \"name\"
