      string: "{\r\n  \"name\" : \"Li2024 - 3D growing domain finite element model
        for simulation BMP patterning formation in early zebrafish embryo\",\r\n  \"format\"
        : {\r\n    \"name\" : \"C/C++\",\r\n    \"identifier\" : \"C_CPP\",\r\n    \"version\"
        : \"*\"\r\n  },\r\n  \"publication\" : {\r\n    \"type\" : \"DOI\",\r\n    \"accession\"
        : \"10.3389/fsysb.2022.983372\",\r\n    \"journal\" : \"Frontiers in Systems
        Biology\",\r\n    \"title\" : \"Determining the role of advection in patterning
        by bone morphogenetic proteins through neural network model-based acceleration
        of a 3D finite element model of the zebrafish embryo\",\r\n    \"affiliation\"
        : \"Purdue University\",\r\n    \"synopsis\" : \"Embryonic development is
        a complex phenomenon that integrates genetic regulation and biomechanical
        cellular behaviors. However, the relative influence of these factors on spatiotemporal
        morphogen distributions is not well understood. Bone Morphogenetic Proteins
        (BMPs) are the primary morphogens guiding the dorsal-ventral (DV) patterning
        of the early zebrafish embryo, and BMP signaling is regulated by a network
        of extracellular and intracellular factors that impact the range and signaling
        of BMP ligands. Recent advances in understanding the mechanism of pattern
        formation support a source-sink mechanism, however, it is not clear how the
        source-sink mechanism shapes the morphogen patterns in three-dimensional (3D)
        space, nor how sensitive the pattern is to biophysical rates and boundary
        conditions along both the anteroposterior (AP) and DV axes of the embryo,
        nor how the patterns are controlled over time. Throughout blastulation and
        gastrulation, major cell movement, known as epiboly, happens along with the
        BMP-mediated DV patterning. The layer of epithelial cells begins to thin as
        they spread toward the vegetal pole of the embryo until it has completely
        engulfed the yolk cell. This dynamic domain may influence the distributions
        of BMP network members through advection. We developed a Finite Element Model
        (FEM) that incorporates all stages of zebrafish embryonic development data
        and solves the advection-diffusion-reaction Partial Differential Equations
        (PDE) in a growing domain. We use the model to investigate mechanisms in underlying
        BMP-driven DV patterning during epiboly. Solving the PDE is computationally
        expensive for parameter exploration. To overcome this obstacle, we developed
        a Neural Network (NN) metamodel of the 3D embryo that is accurate and fast
        and provided a nonlinear map between high-dimensional input and output that
        replaces the direct numerical simulation of the PDEs. From the modeling and
        acceleration by the NN metamodels, we identified the impact of advection on
        patterning and the influence of the dynamic expression level of regulators
        on the BMP signaling network.\",\r\n    \"year\" : 2024,\r\n    \"month\"
        : \"1\",\r\n    \"link\" : \"http://identifiers.org/doi/10.3389/fsysb.2022.983372\",\r\n
