      string: "{\r\n  \"name\" : \"Ioannou2024 - Synthetic Human Infant Gut Microbial
        Community with Human Milk Oligosaccharides\",\r\n  \"description\" : \"These
        are genome-scale metabolic models used for understanding the metabolic activity
        and potential of a synthetic gut microbial community in the context of human
        milk oligossacharides.\",\r\n  \"format\" : {\r\n    \"name\" : \"Other\",\r\n
        \   \"identifier\" : \"UNKNOWN\",\r\n    \"version\" : \"*\"\r\n  },\r\n  \"publication\"
        : {\r\n    \"type\" : \"DOI\",\r\n    \"accession\" : \"10.1093/ismejo/wrae209\",\r\n
        \   \"journal\" : \"The ISME journal\",\r\n    \"title\" : \"Resource sharing
        of an infant gut microbiota synthetic community in combinations of human milk
        oligosaccharides.\",\r\n    \"affiliation\" : \"Laboratory of Microbiology,
        Wageningen University & Research, Stippeneng 4, Wageningen 6708WE, the Netherlands.\",\r\n
        \   \"synopsis\" : \"Quickly after birth, the gut microbiota is shaped via
        species acquisition and resource pressure. Breastmilk, and more specifically,
        human milk oligosaccharides are a determining factor in the formation of microbial
        communities and the interactions between bacteria. Prominent human milk oligosaccharide
        degraders have been rigorously characterized, but it is not known how the
        gut microbiota is shaped as a complex community. Here, we designed BIG-Syc,
        a synthetic community of 13 strains from the gut of vaginally born, breastfed
        infants. BIG-Syc replicated key compositional, metabolic, and proteomic characteristics
        of the gut microbiota of infants. Upon fermentation of a four and five human
        milk oligosaccharide mix, BIG-Syc demonstrated different compositional and
        proteomic profiles, with Bifidobacterium infantis and Bifidobacterium bifidum
        suppressing one another. The mix of five human milk oligosaccharides resulted
        in a more diverse composition with dominance of B. bifidum, whereas that with
        four human milk oligosaccharides supported the dominance of B. infantis, in
        four of six replicates. Reintroduction of bifidobacteria to BIG-Syc led to
        their engraftment and establishment of their niche. Based on proteomics and
        genome-scale metabolic models, we reconstructed the carbon source utilization
        and metabolite and gas production per strain. BIG-Syc demonstrated teamwork
        as cross-feeders utilized simpler carbohydrates, organic acids, and gases
        released from human milk oligosaccharide degraders. Collectively, our results
        showed that human milk oligosaccharides prompt resource-sharing for their
        complete degradation while leading to a different compositional and functional
        profile in the community. At the same time, BIG-Syc proved to be an accurate
        model for the representation of intra-microbe interactions.\",\r\n    \"year\"
        : 2024,\r\n    \"month\" : \"1\",\r\n    \"volume\" : \"18\",\r\n    \"issue\"
        : \"1\",\r\n    \"pages\" : \"wrae209\",\r\n    \"link\" : \"http://identifiers.org/doi/10.1093/ismejo/wrae209\",\r\n
