      string: "{\r\n  \"name\" : \"Diel multi-tissue genome-scale metabolic models
        of Vitis vinifera\",\r\n  \"description\" : \"The first GSSM of V. vinifera
        was reconstructed (MODEL2408120001). Tissue-specific models for stem, leaf,
        and berry of the Cabernet Sauvignon cultivar were generated from the original
        model, through the integration of RNA-Seq data. These models have been merged
        into diel multi-tissue models to study the interactions between tissues at
        light and dark phases.\",\r\n  \"format\" : {\r\n    \"name\" : \"SBML\",\r\n
        \   \"identifier\" : \"SBML\",\r\n    \"version\" : \"L3V1\"\r\n  },\r\n  \"publication\"
        : {\r\n    \"type\" : \"DOI\",\r\n    \"accession\" : \"10.1101/2024.01.30.578056\",\r\n
        \   \"journal\" : \"bioRxiv\",\r\n    \"title\" : \"A diel multi-tissue genome-scale
        metabolic model of<i>Vitis vinifera</i>\",\r\n    \"affiliation\" : \"University
        of Minho\",\r\n    \"synopsis\" : \"Vitis vinifera , also known as grapevine,
        is widely cultivated and commercialized, particularly to produce wine. As
        wine quality is directly linked to fruit quality, studying grapevine metabolism
        is important to understand the processes underlying grape composition. Genome-scale
        metabolic models (GSMMs) have been used for the study of plant metabolism
        and advances have been made, allowing the integration of omics datasets with
        GSMMs. On the other hand, Machine learning (ML) has been used to analyze omics
        data, and while the combination of ML with GSMMs has shown promising results,
        it is still scarcely used to study plants. Here, the first GSSM of V. vinifera
        was reconstructed and validated, comprising 7199 genes, 5399 reactions, and
        5141 metabolites across 8 compartments. Tissue-specific models for stem, leaf,
        and berry of the Cabernet Sauvignon cultivar were generated from the original
        model, through the integration of RNA-Seq data. These models have been merged
        into diel multi-tissue models to study the interactions between tissues at
        light and dark phases. The potential of combining ML with GSMMs was explored
        by using ML to analyze the fluxomics data generated by green and mature grape
        GSMMs, helping to understand the factors influencing grape quality at different
        developmental stages.\",\r\n    \"year\" : 2024,\r\n    \"month\" : \"7\",\r\n
        \   \"link\" : \"http://identifiers.org/doi/10.1101/2024.01.30.578056\",\r\n
        \   \"authors\" : [\r\n      {\r\n        \"name\" : \"Marta Sampaio\",\r\n
        \       \"orcid\" : \"0000-0002-9713-3912\"\r\n      },\r\n      {\r\n        \"name\"
        : \"Miguel Rocha\",\r\n        \"orcid\" : \"0000-0001-8439-8172\"\r\n      },\r\n
        \     {\r\n        \"name\" : \"Oscar Dias\",\r\n        \"institution\" :
        \"Centre of Biological Engineering, University of Minho, Braga, Portugal.\",\r\n
        \       \"orcid\" : \"0000-0002-1765-7178\"\r\n      }\r\n    ]\r\n  },\r\n
        \ \"files\" : {\r\n    \"main\" : [\r\n      {\r\n        \"name\" : \"1_iMS7199_leaf.xml\",\r\n
        \       \"description\" : \"Vitis vinifera leaf berry model\",\r\n        \"fileSize\"
