      string: "{\r\n  \"name\" : \"A genome scale metabolic model for Helicobacter
        pylori26695\",\r\n  \"format\" : {\r\n    \"name\" : \"SBML\",\r\n    \"identifier\"
        : \"SBML\",\r\n    \"version\" : \"L3V1\"\r\n  },\r\n  \"publication\" : {\r\n
        \   \"type\" : \"DOI\",\r\n    \"accession\" : \"10.1111/hel.13074\",\r\n
        \   \"journal\" : \"Helicobacter\",\r\n    \"title\" : \"A reconstructed genome-scale
        metabolic model of Helicobacter pylori for predicting putative drug targets
        in clarithromycin and rifampicin resistance conditions.\",\r\n    \"affiliation\"
        : \"Department of Bioinformatics, Institute of Biochemistry and Biophysics,
        University of Tehran, Tehran, Iran.\",\r\n    \"synopsis\" : \"<h4>Background</h4>Helicobacter
        pylori is considered a true human pathogen for which rising drug resistance
        constitutes a drastic concern globally. The present study aimed to reconstruct
        a genome-scale metabolic model (GSMM) to decipher the metabolic capability
        of H. pylori strains in response to clarithromycin and rifampicin along with
        identification of novel drug targets.<h4>Materials and methods</h4>The iIT341
        model of H. pylori was updated based on genome annotation data, and biochemical
        knowledge from literature and databases. Context-specific models were generated
        by integrating the transcriptomic data of clarithromycin and rifampicin resistance
        into the model. Flux balance analysis was employed for identifying essential
        genes in each strain, which were further prioritized upon being nonhomologs
        to humans, virulence factor analysis, druggability, and broad-spectrum analysis.
        Additionally, metabolic differences between sensitive and resistant strains
        were also investigated based on flux variability analysis and pathway enrichment
        analysis of transcriptomic data.<h4>Results</h4>The reconstructed GSMM was
        named as HpM485 model. Pathway enrichment and flux variability analyses demonstrated
        reduced activity in the ribosomal pathway in both clarithromycin- and rifampicin-resistant
        strains. Also, a significant decrease was detected in the activity of metabolic
        pathways of clarithromycin-resistant strain. Moreover, 23 and 16 essential
        genes were exclusively detected in clarithromycin- and rifampicin-resistant
        strains, respectively. Based on prioritization analysis, cyclopropane fatty
        acid synthase and phosphoenolpyruvate synthase were identified as putative
        drug targets in clarithromycin- and rifampicin-resistant strains, respectively.<h4>Conclusions</h4>We
        present a robust and reliable metabolic model of H. pylori. This model can
        predict novel drug targets to combat drug resistance and explore the metabolic
        capability of H. pylori in various conditions.\",\r\n    \"year\" : 2024,\r\n
        \   \"month\" : \"5\",\r\n    \"volume\" : \"29\",\r\n    \"issue\" : \"2\",\r\n
        \   \"pages\" : \"e13074\",\r\n    \"link\" : \"http://identifiers.org/doi/10.1111/hel.13074\",\r\n
        \   \"authors\" : [\r\n      {\r\n        \"name\" : \"Sepideh Mofidifar\"\r\n
        \     },\r\n      {\r\n        \"name\" : \"Abbas Yadegar\",\r\n        \"orcid\"
        : \"0000-0002-2135-7581\"\r\n      },\r\n      {\r\n        \"name\" : \"Mohammad
        Hossein Karimi-Jafari\"\r\n      }\r\n    ]\r\n  },\r\n  \"files\" : {\r\n
        \   \"main\" : [\r\n      {\r\n        \"name\" : \"HpM485.xml\",\r\n        \"description\"
